VALUES ('5400141155594', 'black tiger scampi', 'Queues de crevettes décortiquées, déveinées et blanchies (calibre 31/40), surgelées-Crevettes (Penaeus monodon), sel. Conditionnées en Belgique. Ingrediënten Geblancheerde, gepelde, ontdarmde garnaalstaarten (maat 31/40), diepvries - Garnalen (Penaeus monodon), zout. Verpakt in België. Bevat schaaldieren. Contient des crustacés. Ces scampis ne contiennent aucun additif (conservateur, colorant, émulsifiant, etc.). Seule une pincée de sel a été ajoutée comme assaisonnement. Oeze scampi\'s bevatten geen toegevoegde hulpstoffen, zoals bewaarmiddelen, kleurstoffen, emulgatoren enz. Er werd enkel wat zout toegevoegd om ze op smaak te brengen. Gemiddelde voedingswaarde-Valeur nutritionnetle megre 100g 1portie 1 portion RI*', 'https://static.openfoodfacts.org/images/products/540/014/115/5594/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

