VALUES ('5400141166194', 'Scampis à la diable', 'Crevettes, sauce piquante à la crème, surgelées 36 % queues de crevettes [crevettes Penaeus vannameil, sell, eau, 10% crème, 5% tomates, 4 % échalotes, 3% vin blanc, 2 % concentré de tomates, 1,6 % piments rouges, amidon modifié, huile de tournesol, bouillon de poisson [fond de poisson (extrait de cabillaud, extrait de colin), maltodextrine, glucose, sel, huiles végétales (colza, tournesol). extrait d\'oignons, extraits de plantes aromatiques, extrait de poivre blanc). sel, ail, 0,2 % poivrons rouges, bouillon de crustacés (extrait de poisson en poudre, maltodextrine, extrait de levure, sel, crevettes en poudre, poisson en poudre, huile de tournesol, extrait de moule en poudre, crabe en poudre, algues en poudre, oignons en poudre. extrait de poivrons, crustacés en poudre, extrait de céleril, estragon, 0,1 % poivre de Cayenne. Contient des crustacés, du poisson, du lait, du céleri et des mollusques. Peut contenir des traces de gluten, d\'ceufs, d\'arachides, de soja, de fruits à coque, de moutarde, de sésame et de sulfites.  C', 'https://static.openfoodfacts.org/images/products/540/014/116/6194/front_fr.16.400.jpg', '5.5', '5.4', '3.2', '1.3', '1', '6.4', '0.93', '0.366141732283465', '', '1');

